import React from 'react';
import Container from '@material-ui/core/Container';
import Icon from '@material-ui/core/Icon';
import KeyboardArrowUpIcon from '@material-ui/icons/KeyboardArrowUp';
import KeyboardArrowRightIcon from '@material-ui/icons/KeyboardArrowRight';
import KeyboardArrowDownIcon from '@material-ui/icons/KeyboardArrowDown';
import KeyboardArrowLeftIcon from '@material-ui/icons/KeyboardArrowLeft';
import SpaceBarIcon from '@material-ui/icons/SpaceBar';
import PanToolIcon from '@material-ui/icons/PanTool';

function RobotInterface() {
  return (
    <div>
    <Container maxWidth="md" id="container"> 
            <br />
            <img id="logoproiect" src="logo_proiect.png" height="200" alt="Xeo Hospital Robot"/>
            <br /><br />
            <img id="videostream" src="hospital_hallway.jpg" width="640" height="480" alt="stream video" />
            <br />
            <table id="arrow-table">
              <tr>
                <td></td>
                <td>
                  <KeyboardArrowUpIcon id="up-arrow"/>
                </td>
                <td></td>
              </tr>
              <tr>
                <td>
                  <KeyboardArrowLeftIcon id="left-arrow"/>
                </td>
                <td>
                  <SpaceBarIcon id="space-arrow"/>
                </td>
                <td>
                  <KeyboardArrowRightIcon id="right-arrow"/>
                  <PanToolIcon id="stop-arrow"/>
                </td>
              </tr>
              <tr>
                <td></td>
                <td>
                  <KeyboardArrowDownIcon id="down-arrow"/>
                </td>
                <td></td>
              </tr>
            </table>
    </Container>
      {/*<img src="stream.mjpg" width="640" height="480" alt="stream video" />*/}
    </div>
  );
}

export default RobotInterface;
